SPEELSE WONING MET CHARME IN GELIEFD NIJMEGEN-NOORD
Op een geliefde locatie, in de luwte van het stadscentrum van Nijmegen, vinden we deze fantastische tussenwoning. Zoekt u een garantie voor kwaliteit en een woning die uitstekend is onderhouden? Dan is dit de woning die u zoekt. Op fietsafstand van Nijmegen Centrum en met natuur- en recreatiegebied de Waaijer en zwemlocatie de Lentse Plas in de achtertuin, de ideale plek om te wonen. Wanneer je op zoek bent naar een modern en comfortabel huis in Nijmegen, dan is de Brink 19 absoluut een woning om te bekijken. Deze woning beschikt over talloze aantrekkelijke kenmerken die het leven aangenaam maken.

Met een mooie architectuur en een zeer gunstige ligging is deze woning uniek in zijn soort. U stapt binnen en het "wonen" kan beginnen. Dit is uw kans op een fijn en rijk (gezins)leven, in een prachtige omgeving waar nog steeds vele ontwikkelingen plaatsvinden op het gebied van recreatie en voorzieningen. In deze ruime woning met drie volwaardige woonlagen, diepe achtertuin, 12 zonnepanelen, vrij uitzicht aan de voorzijde en goed afwerkingsniveau ligt uw toekomst!

IN VRIJHEID WONEN
Er is bij deze woning aandacht besteed aan veel denkbare details. Zowel de binnen- als de buitenkant is zichtbaar met zorg en liefde opgebouwd. Er is gekozen voor duidelijke ruimtes die logisch in elkaar overlopen, waardoor o.a. de benedenverdieping heel open en gezellig is geworden. Alles heeft een functie en een bepaalde knusheid. 

Op de begane grond van de Brink 19 bevindt zich de open keuken, die met recht een pronkstuk van de woning genoemd kan worden. De moderne keuken heeft een dik kunststof blad met betonlook en een hoge spatrand, een spoelbak, een grote 4-pits inductieplaat en ruime pannenlades met besteklade. De vaatwasser, koelkast, vriezer en combi oven van Bosch maken het plaatje compleet. Hierdoor heb je alles bij de hand om de lekkerste maaltijden te bereiden.

De woonkamer heeft een grote glazen pui en openslaande deuren die zorgen voor veel natuurlijke lichtinval en een naadloze overgang naar de achtertuin. De kunststof kozijnen zorgen voor een moderne uitstraling en zijn bovendien onderhoudsvriendelijk. De grote donkere plavuizen vloer met vloerverwarming zorgt voor extra comfort, terwijl de neutrale wanden en plafonds de ruimte een rustige uitstraling geven. In de zomermaanden zorgt het elektrische zonnescherm voor verkoeling op de begane grond. 

VERDIEPING
Op de verdieping vervolgen we de kwaliteit en verrassingen van deze tussenwoning. De overloop vormt hier het hart van de verdieping en biedt toegang tot alle ruimtes. Over de gehele verdieping, exclusief de badkamer, ligt een laminaatvloer die drempelloos is gelegd.
De slaapkamers zijn hierdoor niet alleen aangenaam om te zien, maar ook praktisch in gebruik. Door het ontbreken van drempels zijn de kamers gemakkelijk toegankelijk en vormen ze een veilige omgeving voor jong en oud. Ook de moderne badkamer op deze verdieping is de moeite waard om te noemen. Deze is voorzien van twee waskommen op meubel, een designradiator, een inloopdouche met drain in goot en scherm met deur, en een zwevend toilet. De lichtgrijze wandtegels en donkere vloertegels geven deze ruimte een moderne en frisse uitstraling. Tot slot biedt de overloop op deze verdieping extra bergruimte en zorgt deze voor een goede verbinding tussen de verschillende kamers.

VERRASSENDE VERDIEPING
Een verrassende en zeer volwaardige woonlaag waarin de kwaliteit en het afwerkingsniveau volledig is doorgetrokken en welke is afgewerkt met een lichte laminaatvloer. Op weg naar deze verdieping merk je direct dat je in een sfeervolle ruimte terecht komt. Op deze bovenste verdieping is een extra slaapkamer gerealiseerd en is er een apart washok aanwezig. De slaapkamer heeft een groot dakraam waardoor er veel natuurlijk licht binnenkomt. De neutrale afwerking zorgt ervoor dat de ruimtes volledig naar eigen wens ingericht kunnen worden.

BUITEN LEVEN
Strakke lijnen, symmetrie, minimalisme en toch een luxe touch, stoere details met een knipoog naar de landelijke stijl; ze zijn overal terug te vinden. Die consequente stijl is ook doorgevoerd in de tuin. De woning heeft een diepe achtertuin op het westen met een gazon, borders en een houten berging. Via het achterom is er toegang tot het parkeerterrein. Aan de voorzijde van de woning is er een fietspad en speeltuin aanwezig. Hierdoor is het ook voor kinderen een aangename plek om te wonen. De woning heeft aan de voorzijde een stijlvolle veranda en is ideaal voor gezinnen.

ALGEMEEN
De woning is bovendien voorzien van HR++ beglazing, glasvezel, stadsverwarming en brandmelders. De moderne meterkast heeft 9 groepen en 3 aardlekschakelaars. Kortom, deze woning aan de Brink 19 in Nijmegen heeft alles wat je zoekt in een moderne en comfortabele gezinswoning.

GELIEFDE OMGEVING
Nijmegen-Noord heeft veel te bieden voor jong en oud. De woonwijk is opgebouwd met veel groen en water, in een zeer kindvriendelijke woonomgeving. Binnen 15 minuten fietsen ben je in het bruisende centrum van Nijmegen. Op fietsafstand vinden we ook het natuur- en recreatiegebied De Waaijer waarbij de Lentse Plas ook een officiële zwemlocatie is. Uiteraard biedt de Oosterhoutse plas een heerlijk wandel- en uitwaaigebied. Verderop vinden we de welbekende Nevengeul, welke tussen 2013 en 2015 is aangelegd om bij hoog water in de Waal meer water op te vangen in de geul. Hierdoor is de Spiegelwaal ontstaan. Een heerlijk water welke bijzonder geschikt is voor watersporten als kanovaren, roeien, windsurfen en zeilen. Uiteraard ook heerlijk om te zwemmen.
Wonen in Nijmegen-Noord, nabij de uitvalswegen A50 en A15 richting de steden Arnhem, Nijmegen en Tiel, is als wonen in de schaduw van de grote stad maar dan met bescherming van het dorpse buitenleven. In de directe omgeving kan je heerlijk wandelen in de uiterwaarden en het Oosterhoutse bos. De woning ligt op loop/fiets afstand van voorzieningen zoals winkels, basisscholen, horeca gelegenheden en sportvoorzieningen. Al met al ligt deze prachtige woning op een locatie die moeilijk te evenaren is.

BIJZONDERHEDEN
Op deze locatie staat, vriendelijk en uitnodigend, deze mooie tussenwoning uit 2016 die in elk opzicht op een stijlvolle manier gemoedelijkheid uitstraalt. Wie het geluk heeft hier op te groeien, beleeft een jeugd uit duizenden. Deze woning biedt nog de volgende bijzonderheden:

- Goed onderhoud- en afwerkingsniveau;
- Zonnepanelen 12 stuks;
- Instap klaar woonhuis;
- Volledig geïsoleerd;
- HR++ beglazing;
- Energielabel A (zonnepanelen nog niet meegenomen);
- Verbruik elektra 2021/2022 1.406 kWh;
- Terug levering elektra 2021/2022 2.066 kWh;
- Verbruik stadsverwarming 2021/2022 40,09 kWh;
- Verbruik elektra + stadsverwarming 2021/2022 circa € 122,- per maand;
- Vloerverwarming gedeeltelijk;
- Tuin op het westen;
- Zonnescherm elektrisch;
- Stadsverwarming;
- Moderne badkamer en keuken;
- Zeer kindvriendelijke woonomgeving;
- Directe gelegen aan groen- en waterrijk park;
- Nabij Nijmegen centrum (ca. 15 fietsminuten);
- Nabij Station Lent (ca. 10 fietsminuten);
- Nabij uiterwaarden van de Waal (ca. 10 fietsminuten);
- Nabij uitvalswegen richting Arnhem, Nijmegen, Tiel (ca. 2 autominuten)
- Direct nabij de Oosterhoutse plas (ca. 10 minuten loopafstand).

Deze informatie is door ons met de nodige zorgvuldigheid samengesteld. Onzerzijds wordt echter geen enkele aansprakelijkheid aanvaard voor enige onvolledigheid, onjuistheid of anderszins, dan wel de gevolgen daarvan.
